import Layout from '../components/MyLayout';
import Link from 'next/link';
const PostLink = props => (
    <li>
        <Link
            href={`/${props.id}`}
            href={{
                pathname: "/newspost",
                query: { id: props.id }
              }}
            >
            <a>{props.title}</a>
        </Link>
    </li>
);
export default function Index() {
    return (
        <Layout>
            <PostLink id="hello-next" title="Hello Next.js" />
        </Layout>
    );
}
